import React from "react";
import "./UserSelectBtn.css";

function UserSelectBtn() {
  return (
    <div id="buttonContainer">
      <button id="gameButton1">Create Game</button>
      <button id="gameButton2">Join Lobby</button>
    </div>
  );
}

export default UserSelectBtn;
